import React, { Component } from 'react';

export class App extends Component {
    constructor() {
        super();
        this.state = {
            firstName: "",
            lastName: "",
            age: "",
        };
        this.onChange = this.onChange.bind(this);
    }

    onChange(event) {
        const { name, type, value, checked } = event;

        this.setState({
            [name]: value
        });
    }

    render() {
        return (
            <div>
                <form>
                    <input
                        name='firstName'
                        type="text"
                        placeholder="First Name"
                        onChange={this.handleChange}>
                    </input>

                    <input
                        name="firstName"
                        type="text"
                        placeholder="Last Name"
                        onChange={this.handleChange}>
                    </input>

                    <input
                        name="age"
                        type="text"
                        placeholder="Age"
                        onChange={this.handleChange}>
                    </input>
                </form>
            </div>
        )
    }
}
export default App;
